import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import authService from '../services/authService';
import '../styles/Auth.css';

const Register = () => {
  const [userData, setUserData] = useState({
    username: '',
    email: '',
    password: '',
    confirmPassword: ''
  });
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value } = e.target;
    setUserData({
      ...userData,
      [name]: value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');

    // Validar que las contraseñas coincidan
    if (userData.password !== userData.confirmPassword) {
      setError('Las contraseñas no coinciden');
      setLoading(false);
      return;
    }

    try {
      // Eliminar confirmPassword antes de enviar al servidor
      const { confirmPassword, ...registerData } = userData;
      
      console.log('Enviando datos de registro:', registerData);
      
      const response = await authService.register(registerData);
      console.log('Registration successful:', response);
      
      // Redirigir a la página de inicio de sesión
      navigate('/login', { state: { message: 'Registro exitoso. Por favor, inicie sesión.' } });
    } catch (error) {
      console.error('Registration error:', error);
      
      // Manejo más detallado de errores
      if (error.response && error.response.data) {
        // Mostrar errores específicos del servidor
        const serverErrors = error.response.data;
        let errorMessages = [];
        
        if (typeof serverErrors === 'object') {
          // Si es un objeto con múltiples errores
          for (const key in serverErrors) {
            if (Array.isArray(serverErrors[key])) {
              errorMessages.push(`${key}: ${serverErrors[key].join(' ')}`);
            } else {
              errorMessages.push(`${key}: ${serverErrors[key]}`);
            }
          }
        } else if (typeof serverErrors === 'string') {
          // Si es un mensaje de error simple
          errorMessages.push(serverErrors);
        } else {
          // Fallback para otros formatos
          errorMessages.push('Error en el registro. Por favor, intente de nuevo.');
        }
        
        setError(errorMessages.join('\n'));
      } else if (error.message) {
        setError(error.message);
      } else {
        setError('Error al registrarse. Por favor, intente de nuevo.');
      }
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="auth-container">
      <div className="auth-form-container">
        <h1>Registrarse</h1>
        
        {error && <div className="error-message">{error}</div>}
        
        <form onSubmit={handleSubmit} className="auth-form">
          <div className="form-group">
            <label htmlFor="username">Usuario</label>
            <input
              type="text"
              id="username"
              name="username"
              value={userData.username}
              onChange={handleChange}
              required
            />
          </div>
          
          <div className="form-group">
            <label htmlFor="email">Correo Electrónico</label>
            <input
              type="email"
              id="email"
              name="email"
              value={userData.email}
              onChange={handleChange}
              required
            />
          </div>
          
          <div className="form-group">
            <label htmlFor="password">Contraseña</label>
            <input
              type="password"
              id="password"
              name="password"
              value={userData.password}
              onChange={handleChange}
              required
              minLength="8"
            />
          </div>
          
          <div className="form-group">
            <label htmlFor="confirmPassword">Confirmar Contraseña</label>
            <input
              type="password"
              id="confirmPassword"
              name="confirmPassword"
              value={userData.confirmPassword}
              onChange={handleChange}
              required
              minLength="8"
            />
          </div>
          
          <button 
            type="submit" 
            className="btn-primary"
            disabled={loading}
          >
            {loading ? 'Registrando...' : 'Registrarse'}
          </button>
        </form>
        
        <div className="auth-links">
          <p>¿Ya tiene una cuenta? <Link to="/login">Iniciar Sesión</Link></p>
          <p><Link to="/">Volver al inicio</Link></p>
        </div>
      </div>
    </div>
  );
};

export default Register;
